import React from "react";
import './social.css'
function BottomBox(){
    return(
        <>
        <div className="bottom-box">
            
            <p className="box-text">2023</p>
            <p className="box-text">&#169;</p>
            <p className="box-text">Laundry</p>
        </div>
        </>
    )
}

export default BottomBox
